import React, { useEffect, useState } from 'react';

const ProjetData = () => {
  const [svgContent, setSvgContent] = useState(null);

  useEffect(() => {
    fetch('C:/Users/X280/Downloads/PalladioGraph.svg') // Chemin vers ton fichier SVG
      .then((response) => response.text())
      .then((data) => setSvgContent(data));
  }, []);

  return (
    <div>
      <h1>Mon fichier SVG chargé dynamiquement</h1>
      <div dangerouslySetInnerHTML={{ __html: svgContent }} /> {/* Utilisation de dangerouslySetInnerHTML pour insérer le SVG */}
    </div>
  );
}

export default ProjetData;
